o.x:
var $bm_rt;
var A, Start, Start, Start;
try {
    A = effect('Animation')(1);
    if (A.numKeys > 1) {
        Start = A.key(1).time;
    } else {
        Start = inPoint;
    }
} catch (err) {
    Start = inPoint;
}
$bm_rt = ease(time, Start, $bm_sum(Start, $bm_mul(1 / 30, 6)), 0, 100);

v.x:
var $bm_rt;
var AK, Width, Start, End, WipeCenter;
AK = effect('Animation')(1);
Width = $bm_div(effect('Wipe Width')(1), 2);
Start = AK.key(1).value;
End = AK.key(2).value;
WipeCenter = effect('Wipe Center')(1);
$bm_rt = linear(AK, Start, End, WipeCenter, [
    $bm_sum(WipeCenter[0], Width),
    WipeCenter[1]
]);

var $bm_rt;
var AK, Width, Start, End, WipeCenter;
AK = effect('Animation')(1);
Width = $bm_div(effect('Wipe Width')(1), 2);
Start = AK.key(1).value;
End = AK.key(2).value;
WipeCenter = effect('Wipe Center')(1);
$bm_rt = linear(AK, Start, End, WipeCenter, [
    $bm_sub(WipeCenter[0], Width),
    WipeCenter[1]
]);
